INSERT INTO `d_program_0` VALUES (2,2,1,2,1,1,'韦礼安「一直都在」音乐会','韦礼安','JDG英特尔电子竞技中心','https://s21.ax1x.com/2024/06/06/pkYEY9K.png',1,'本商品为预售商品，正式开票后将第一时间为您配票','预售期间，由于主办未正式开票，下单后无法立即为您配票。一般于演出前1-2周开票，待正式开票后，请您通过订单详情页或者票夹详情，查看票品信息、取票方式等演出相关信息','<div class=\"words\"><p><div style=\"text-align: left;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i211.1dfe106eT6n5Lp\"><strong data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i8.1dfe106eW0Gc5h\">活动介绍</strong></div><div data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i206.1dfe106eT6n5Lp\" style=\"text-align: center;\">韦礼安「一直都在」音乐见面会-北京站</div><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_reviewer_check.0.i1.8bd1106etyyPIZ\">是你的爱指引我未来<br>深深拥抱我的现在<br>告诉我原来爱一直都在</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_reviewer_check.0.i1.8bd1106etyyPIZ\"><img src=\"//img.alicdn.com/imgextra/i3/2251059038/O1CN019oiOfh2GdSYbtwJyA_!!2251059038.jpg_q60.jpg_.webp\" width=\"750\" height=\"1050\" damai_width=\"750\" damai_height=\"1050\"><br></p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i32.5e41106eGtOdMa\">时间：2024年1月13日（周六）20:00</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i220.1dfe106eT6n5Lp\">地点：EAST &nbsp;LIVE（东郎展演中心）</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i220.1dfe106eT6n5Lp\">地址：北京市朝阳区建国门外郎家园10号61幢1层A3-062层(印艺文创园内)</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2oeg.project.detail-info.i0.124a7445eFkOZ7\">票务信息</p><p style=\"text-align: center;\">VIP¥488</p><p style=\"text-align: center;\"><u><strong data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i48.5e41106eOtr9fH\">（VIP权益：提前进场&amp;站前区&amp;巡演亲笔签名海报&amp;有机会获得与韦礼安合影机会）</strong></u></p><p style=\"text-align: center;\"><u><strong>备注：合影机会以现场抽签形式获得，限量6组，每组5人</strong></u></p><p style=\"text-align: center;\"><img src=\"//img.alicdn.com/imgextra/i4/2251059038/O1CN01dPeNja2GdSWgyxL8e_!!2251059038.jpg_q60.jpg_.webp\"><br></p><p style=\